var current_chart = null;
var destroy_current = function() {
	if(current_chart) {
		current_chart.destroy();
	}
}

var current_by_rank = function() {
	destroy_current();
	var days = [];
	var users = [];
	$.each(data, function(user, info) {
		if(info.current_rank) {
			var idx = parseInt(info.current_rank) - 1
			var added = moment(info.added_date)
			var now = moment()
			var day_count = now.diff(added, 'days')
			users[idx] = user + ' #' + info.current_rank;
			days[idx] = day_count;
		}
	});
	
	var ctx = $('#redefchart');
	var hbar = new Chart(ctx, {
		type: 'horizontalBar',
		data: {"labels": users, "datasets": [{'label': 'User\'s number of days', 'data': days, backgroundColor: colors}]}
	});
	current_chart = hbar;
};

var cohorts = function() {
	destroy_current();
	var labels = [];
	var user_counts = {};
	$.each(data, function(user, info) {
		if(info.current_rank) {
			var cohort = info.added_date;
			if(!labels.includes(cohort)) {
				labels.push(cohort);
				user_counts[cohort] = 0;
			}
			user_counts[cohort] ++;
		}
	});
	labels.sort();
	var counts_sorted = [];
	$.each(labels, function(idx, lbl) {
		counts_sorted.push(user_counts[lbl]);
	});

	var pie = new Chart($('#redefchart'), {
		type: 'pie',
		data: {labels: labels, datasets: [{label: 'Cohort user count', 'data': counts_sorted, backgroundColor: colors}]}
	});
	current_chart = pie;
};

$('.copt').click(function(e) {
	var cmd = $(this).attr('href');
	if(cmd == '#current') {
		current_by_rank()
	}
	else if(cmd == '#cohorts') {
		cohorts();
	}
});
</script>
